import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import Button from 'react-bootstrap/Button';

export default function AppWedo() {
    return(

        <Container className='whatwedo'>
            <div className='whatwedo'>
      <Row>
        <Col><h1 className='heading1'>What we do</h1></Col>
        <Col>
        <p className='longtext1'>Your all-in-one solution for production accounting and payroll is here. With streamlined onboarding, shortened processing times, and industry-leading service, it's the only app you'll ever need.</p>
        <div className='button'><Button variant="primary">Explore more    <i class="fa-solid fa-angle-right"></i></Button></div>
        </Col>
      </Row>
      </div>
    </Container>

    )
}
